    //! The hrtf class gives the impulse responses to decode in the binaural mode.
    /** The hrtf class gives the impulse responses to decode in the binaural mode in 2d / 3d / simple and double precision.
     */
    template <Dimension D, typename T> class Hrtf
    {
    public:
        //! Get the impulse response of the HRTFs
        /** The impulse response may be 2d/3d with simple /double precision.
         */
        virtual const float* getImpulse() noexcept = 0;
    };

    template<> class Hrtf <Hoa2d, float>
    {
    public:
        //! Get the impulse response of the HRTFs
        /** Get the impulse response of the HRTFs
         */
        static const float* getImpulse() noexcept
        {
            return Impulse2DFloat;
        }
    };

    template<> class Hrtf <Hoa2d, double>
    {
    public:
        //! Get the impulse response of the HRTFs
        /** Get the impulse response of the HRTFs
         */
        static const double* getImpulse() noexcept
        {
            return Impulse2DDouble;
        }
    };

    template<> class Hrtf <Hoa3d, float>
    {
    public:
        //! Get the impulse response of the HRTFs
        /** Get the impulse response of the HRTFs
         */
        static const float* getImpulse() noexcept
        {
            return Impulse3DFloat;
        }
    };

    template<> class Hrtf <Hoa3d, double>
    {
    public:
        //! Get the impulse response of the HRTFs
        /** Get the impulse response of the HRTFs
         */
        static const double* getImpulse() noexcept
        {
            return Impulse3DDouble;
        }
    };

